module.exports = function(obj) {

    var self = this;

    var q = async.queue(function (task, callback) {
        var args = task.args;
        args.push(function(err, data){
            task.cb(err, data);
            if (err) return callback(err);
            callback();
        })
        obj[task.func].apply(obj, args);
    }, 1);

    var keys = Object.keys(obj);

    var buildFuncWrapper = function(i) {
       self[keys[i]] = function() {
            var task = {
                func: keys[i],
                args: arguments.slice(0, arguments.length - 1),
                cb: arguments.slice(arguments.length - 1, arguments.length)
            };
            q.push(task, function(){
                if (global.DEBUG) console.log("[SYNC WRAPPER] finished wrapped call to: ", keys[1]);
            })
        } 
    }

    for (var i = 0; i < keys.length; i++) {
        buildFuncWrapper(i);
    }
}

