var Q = require('q');

function readFirstLine (path) {
  return Q.promise(function (resolve, reject) {
    var rs = fs.createReadStream(path, {encoding: 'utf8'});
    var acc = '';
    var first = true;
    var pos = 0;
    var index;
    rs
      .on('data', function (chunk) {
        if (first) {
          index = chunk.indexOf('\n');
          if (index !== -1) {
            acc = chunk;
            rs.close();
          } else {
            acc += chunk;
            pos += chunk.length;
            first = false;
          }
        } else {
          index = chunk.indexOf('\n');
          acc += chunk;
          index !== -1 ? rs.close() : pos += chunk.length;
        }
      })
      .on('close', function () {
        first ? resolve(acc.slice(0, index)) : resolve(acc.slice(0, pos + index));
      })
      .on('error', function (err) {
        reject(err);
      })
  });
}

