    var cnt = list.length;
    var responses = [];

    list.forEach(function(url, index) {
        request(url, function(error, response, body) {
            if (error) {
                fn(error);
            } else {
                responses[index] = response;
                --cnt;
                if (cnt === 0) {
                    fn(0, responses);
                }
            }
        });
    })

}


