        return result;
    }
    var prev = result[result.length - 1];
    if (prev.date === cur.date) {
        // prev item date matches current - merge the values arrays
        prev.values = prev.values.concat(cur.values)
        result[result.length - 1] = prev;
        return result;
    }
    // prev item date is different, add new element
    result.push(cur);
    return result;
