class WeakMapObj extends Map {
    constructor(iterable) {
        super();
        // we have to implement our own constructor argument processing
        // because the Map constructor doesn't use our custom .set() logic
        if (iterable) {
            for (let array of iterable) {
                this.set(array[0], array[1]);
            }
        }
    }

    // when we get notification that an object is being GCed, we remove it's weak reference
    // from the WeakMapObj
    weakCallback(key) {
        this.delete(key);
    }

    // override that turns object data into a weak reference
    set(key, obj) {
        if (typeof obj === "object") {
            let ref = weak(obj, this.weakCallback.bind(this, key));
            super.set(key, ref);
        } else {
            // not an object, can just use regular method
            super.set(key, obj);
        }
    }
}

const weak = require('weak');
class WeakMapObj {
    constructor(iterable) {
        this._map = new Map();
        if (iterable) {
            for (let array of iterable) {
                this.set(array[0], array[1]);
            }
        }
    }

    set(key, obj) {
        if (typeof obj === "object") {
            let ref = weak(obj, this.delete.bind(this, key));
            this._map.set(key, ref);
        } else {
            // not an object, can just use regular method
            this._map.set(key, obj);
        }
    }

    // get the actual object reference, not just the proxy
    get(key) {
        let obj = this._map.get(key);
        if (obj) {
            return weak.get(obj);
        } else {
            return obj;
        }
    }

    has(key) {
        return this._map.has(key);
    }

    clear() {
        return this._map.clear();
    }

    delete(key) {
        return this._map.delete(key);
    }
}

