  return n < 0 ?
    `(${addCommas(Math.abs(n).toFixed(1))})` :
    addCommas(n.toFixed(1));
}
function addCommas(n) {
  n = String(n), x = n.split('.'), x1 = x[0], x2 = x.length > 1 ? '.' + x[1] : '', rgx = /(\d+)(\d{3})/;
  while (rgx.test(x1)) x1 = x1.replace(rgx, '$1' + ',' + '$2');
  return x1 + x2;
}
