const reduceArray = (inArr, key) => {
    const reduced = inArr.reduce((prev, cur) => {
        const copied = { ...cur }
        delete copied[key]
        const existing = prev.find(item => item[key] === cur[key])
        if (existing) {
            existing.results.push(copied)
        } else {
            const newItem = {
                [key]: cur[key],
                results: [copied]
            }
            prev.push(newItem)
        }
        return prev
    }, [])
    return reduced
}
